const Home = () => {
  const { state } = useContext(ContextGlobal);

  useEffect(() => {
  }, []);

  return (
    <main className={state.theme === "dark" ? "dark" : ""}>
      <h1>Home</h1>
      <div className='card-grid'>
        {state.data.map(dentist => (
          <Card key={dentist.id} {...dentist} />
        ))}
      </div>
    </main>
  );
};

export default Home;
